import { Grid, TextField } from '@material-ui/core';

const SignUp = () => {
	return (
		<Grid container >
			<TextField 
				id="outlined-basic" 
				label="firstName" 
				variant="outlined" 
			/>
			<TextField 
				id="outlined-basic" 
				label="last name" 
				variant="outlined" 
			/>
		</Grid>
	);
};

export default SignUp;
